import React, { useEffect } from 'react';
import { Link, NavLink, Outlet, useNavigate } from 'react-router-dom';
import logo from '../IIITH_logo.png';
import 'bootstrap/dist/css/bootstrap.css';

const Layout = () => {
  const navigate = useNavigate();

  useEffect(() => {
    // Initialize Bootstrap dropdown
    const dropdowns = document.querySelectorAll('.dropdown-toggle');
    dropdowns.forEach((dropdown) => {
      dropdown.addEventListener('click', () => {
        dropdown.nextElementSibling.classList.toggle('show');
      });
    });

    // Close dropdown when clicked outside
    window.addEventListener('click', (event) => {
      if (!event.target.matches('.dropdown-toggle')) {
        const dropdowns = document.querySelectorAll('.dropdown-menu');
        dropdowns.forEach((dropdown) => {
          if (dropdown.classList.contains('show')) {
            dropdown.classList.remove('show');
          }
        });
      }
    });
  }, []);

  const handleLogout = () => {
    // Clear the token and userEmail in localStorage
    localStorage.setItem('token', null);
    localStorage.setItem('userEmail', null);
  };

  const userEmail = localStorage.getItem('userEmail');

  const handleLinkClick = () => {
    if (userEmail === null) {
      navigate('/login');
    }
  };

  return (
    <div className="container">
      {/* Logo and Heading */}
      <div className="d-flex align-items-center justify-content-between">
        <img src={logo} alt="Logo" width="180" />
        <h1 className="mr-3">Visual Inspection Tool</h1>
      </div>

      {/* Navigation Bar */}
      <nav className="mt-3" style={{ display: "flex", justifyContent: "flex-end" }}>
        <ul className="nav">
          <li className="nav-item dropdown">
            <button className="nav-link dropdown-toggle btn" type="button" data-toggle="dropdown">
              Dataset
            </button>
            <ul className="dropdown-menu">
              <li>
                <Link
                  to={userEmail !== null ? "/dataset/view" : "/login"}
                  className="dropdown-item"
                  onClick={handleLinkClick}
                >
                  View Dataset
                </Link>
              </li>
              <li>
                <Link
                  to={userEmail !== null ? "/dataset/upload" : "/login"}
                  className="dropdown-item"
                  onClick={handleLinkClick}
                >
                  Upload Dataset
                </Link>
              </li>
            </ul>
          </li>
          <li className="nav-item dropdown">
            <button className="nav-link dropdown-toggle btn" type="button" data-toggle="dropdown">
              Model
            </button>
            <ul className="dropdown-menu">
              <li>
                <Link
                  to={userEmail !== null ? "/model/view" : "/login"}
                  className="dropdown-item"
                  onClick={handleLinkClick}
                >
                  View Model
                </Link>
              </li>
              <li>
                <Link
                  to={userEmail !== null ? "/model/train" : "/login"}
                  className="dropdown-item"
                  onClick={handleLinkClick}
                >
                  Train Model
                </Link>
              </li>
            </ul>
          </li>
          <li className="nav-item dropdown">
            <button className="nav-link dropdown-toggle btn" type="button" data-toggle="dropdown">
              Rules
            </button>
            <ul className="dropdown-menu">
              <li>
                <Link
                  to={userEmail !== null ? "/rules/create" : "/login"}
                  className="dropdown-item"
                  onClick={handleLinkClick}
                >
                  Create Rules
                </Link>
              </li>
              <li>
                <Link
                  to={userEmail !== null ? "/rules/view" : "/login"}
                  className="dropdown-item"
                  onClick={handleLinkClick}
                >
                  View Rules
                </Link>
              </li>
            </ul>
          </li>
          <li className="nav-item">
            <NavLink to="/deploy" className="nav-link" onClick={handleLinkClick}>
              Deployment
            </NavLink>
          </li>
          <li className="nav-item">
            <NavLink to="/login" className="nav-link" onClick={handleLogout}>
              Logout
            </NavLink>
          </li>
        </ul>
      </nav>
      {/* Render the current route */}
      <Outlet />
    </div>
  );
};

export default Layout;
